import React from 'react';
import {Nav} from 'react-bootstrap';
import {MainContent} from "./Enums/MainContent";

type SidebarProps = {
    setContent(mainContent : MainContent) : void;
}
function SidebarContent(props : SidebarProps){

    const currentPage = window.location.href;

    return (
        <Nav variant="pills" defaultActiveKey={currentPage} className="flex-column">
            <Nav.Item>
                <Nav.Link href={currentPage} onClick={() => {props.setContent(MainContent.Main)}}>Finances</Nav.Link>
            </Nav.Item>
            <Nav.Item>
                <Nav.Link eventKey="link-1" onClick={() => {props.setContent(MainContent.Charts)}}>Charts</Nav.Link>
            </Nav.Item>
        </Nav>
    );
}

export default SidebarContent;
